let styles = {
  circleStyles: {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    margin: "5px",
    width: "40px",
    height: "40px",
    background: "rgb(222, 221, 221)",
    borderRadius: "50%",
  },
  imageStyles: {
    height: "24px",
    width: "24px"
  }
}

function CircularIcon(props) {
  styles.circleStyles.background = this.state.hover ? "rgb(89, 89, 89)" : "rgb(221, 221, 221)";
  return (
    <div style = {styles.circleStyles}>
      <img src = {require("./../images/icons/" + props.type + "Icon.png").default} style = {styles.imageStyles}></img>
    </div>
  )
}

export default CircularIcon;
